mapper.select:
select 

from ONLINESUBTRANSHIST
where SUBTRANSSEQNBR = #{subtransseqnbr,jdbcType=VARCHAR}
  and TRANSSEQNBR = #{transseqnbr,jdbcType=VARCHAR}

mapper.delete:
delete from ONLINESUBTRANSHIST
where SUBTRANSSEQNBR = #{subtransseqnbr,jdbcType=VARCHAR}
  and TRANSSEQNBR = #{transseqnbr,jdbcType=VARCHAR}
